<body>

        <div d-datakey="objects" d-datatype="array" d-datavalue="[{&quot;name&quot;: &quot;1664822877519&quot;},{&quot;name&quot;: &quot;1664822878255&quot;},{&quot;name&quot;: &quot;1664822873458&quot;}]"></div>
        <div d-datakey="objectsQuery" d-datatype="query" d-datavalue="SELECT Max(name) AS Max FROM objects"></div>
        <div>
            <span>1664822878255</span>
        </div>
    </div>

</body></html>
